// Simplest way to integrate with website is use CURL
// The file is for preview only - for each user we provide dedicated script package
<?php
$ch = curl_init();

//execute API proc
//in this case we want to preflight check business card with target dimensions 90mmx50mm
curl_setopt($ch, CURLOPT_URL, 'https://api.preflightapi.com:3131/api/rest/Service/DoPreflight/90x50/1/1/');
curl_setopt($ch, CURLOPT_RETURNTRANSFER, 1);
curl_setopt($ch, CURLOPT_CUSTOMREQUEST, 'GET');

//we get file to check in 
curl_setopt($ch, CURLOPT_POSTFIELDS, "");

$headers = array();
$headers[] = 'Authorization: Basic QWxhZGRpbjpPcGVuU2VzYW1l';
$headers[] = 'Content-Type: application/pdf';
curl_setopt($ch, CURLOPT_HTTPHEADER, $headers);

$result = curl_exec($ch);
if (curl_errno($ch)) {
    echo 'Error:' . curl_error($ch);
}
curl_close($ch);
?>
